import styled from "styled-components";

const AccountStyle = {
    ContainerAccount: styled.div`
    `,
    SideBar: styled.nav`
    width: 100px;
    display: block;
    position: absolute;
    background-color: blue;
    padding: 0;
    height: 100vh;
    margin: -20px 0 0 -20px
    `
}

export default AccountStyle
